input.script:
// Trigger print dialog to save as PDF
// This mimics the browser's print to PDF functionality
window.print();

// Prepare document for PDF export
// Expand all sections that might be collapsed
const detailsElements = document.querySelectorAll('details');
detailsElements.forEach(detail => detail.open = true);

// Ensure all tabs are visible in print mode
const tabContents = document.querySelectorAll('.tab-content');
tabContents.forEach(content => content.style.display = 'block');

// Return page info for PDF generation
({
  title: document.title,
  ready: true,
  sectionsExpanded: detailsElements.length,
  tabsVisible: tabContents.length
})
